//THESE FUNCTIONS ALLOW SELECTION OF EVERY SECOND/FIFTH ELEMENT IN A LIST - USED FOR PLACEMENT OF ACCESSIBILITY INFO IN TABLE ROWHEADERS
function isDivByTwo(value) {
	if (value%2 == 0)
		return true;
	else
		return false;
}

function isDixBySix(value) {
	if (value%6 == 0)
		return true;
	else
		return false;
}

