//THIS FUNCTION SORTS AND REDRAWS THE BAR CHART & REASSIGNS MATCHING COLORS WHEN THE TABLE CHART IS SORTED
function sortMe(event) {
	bChart.setView({'rows':event.sortedIndexes,'columns':mycolschart});
	var list = [];
	var oldList = event.sortedIndexes;
  var colorStartStyle = {
    type: 'string',
    role: 'style',
    calc: colorStartList,
  };
  function colorStartList (dt, row) {
    var value = dt.getValue(row, 5);
    list.push({id:list.length,value:value});
    var listItem = oldList[list.length-1];
    switch (listItem) {
      case 0:
        return {v:'color:#3366cc'};
        break;
      case 1:
        return {v:'color:#dc3912'};
        break;
      case 2:
        return {v:'color:#ff9900'};
        break;
      case 3:
        return {v:'color:#109618'};
        break;
      case 4:
        return {v:'color:#990099'};
        break;
      case 5:
        return {v:'color:#0099c6'};
        break;
      case 6:
        return {v:'color:#dd4477'};
        break;
      case 7:
        return {v:'color:#66aa00'};
        break;
      case 8:
        return {v:'color:#b82e2e'};
        break;
      default:
        //should never trigger
        alert('something went wrong - colorStartList');
        alert(listItem);
        return 'Error!';
        break;
    }
  };
	mycolschart[0]=valueStrings2;  
	mycolschart[2]=colorStartStyle;
	bChart.draw();
	list = [];
	postSort();
	google.visualization.events.removeListener(sortListener);
}

